class NearbyPlaces extends React.Component {

    render() {
        return(
            <div className="container">
                <center><h1>Things to do nearby</h1></center>
                <div className="row">
                    <div className = "col-md">
                        <h3>Restaurants</h3>
                    </div>
                    <div className="col-md">
                        <h3>Bars</h3>
                    </div>
                    <div className="col-md">
                        <h3>Others</h3>
                    </div>
                </div>

            </div>
        )
    }
} export default NearbyPlaces
